import axios from "axios";

const API_URL = "https://srijandubey.github.io/campus-api-mock/SRM-C1-25.json";

// Function to fetch doctors
export const fetchDoctors = async () => {
  try {
    const res = await axios.get(API_URL); // Making the GET request to the API
    return res.data; // Return the response data (doctor data)
  } catch (error) {
    console.error("Error fetching doctors:", error); // Log error in case of failure
    throw error; // Rethrow the error so calling function can handle it
  }
};
